import React from "react"
import { Card, CardContent, Typography } from "@material-ui/core"

export default function PostCard() {
    return (
        <Card>
            <CardContent>
                <Typography variant="h4">
                    Create a post
                </Typography>
            </CardContent>
        </Card>
    );
}
